/*This page is to load Error Page whenever there is an error that occurs at any time 
during processing */

import Box from "@mui/material/Box";
import Grid from "@mui/material/Grid";
import LocationOffOutlinedIcon from '@mui/icons-material/LocationOffOutlined';
import Typography from "@mui/material/Typography";


const ErrorPage = () => {
	return (
		<Box sx={{flexGrow: 1}}>
			<Grid container>
				<Grid container item spacing={4}>
					<Grid item xs={4}/>
					<Grid item xs={4}>
						<div style={{display: 'flex', marginTop: "8%" ,justifyContent: 'center', }}>
							<LocationOffOutlinedIcon style={{
								color: '#ffffff',
								background: "#f50057",
								padding: '0.6em 0.6em',
								display: 'inline-block',
								borderRadius: '60px'
							}}/>
						</div>
						<div style={{display: 'flex', justifyContent: 'center'}}>
							<Typography
								variant="inherit"
								noWrap
								sx={{
									color: 'inherit',
									fontSize: "25px",
								}}
							>
								404 Not Found
							</Typography>
						</div>
					</Grid>
					<Grid item xs={4}/>
				</Grid>
			</Grid>
		</Box>
	);
};

export default ErrorPage;
